using System.Text.RegularExpressions;

namespace Pascal;


public class GraphClassification
{
    static Regex codeComment = new Regex(@"\/\*[^*]*\*\/", RegexOptions.Multiline);

    public static string removeComments(string? signatureWithComments)
    {
        return codeComment.Replace(signatureWithComments ?? "", "");
    }

    class NoCommentsComparer : IComparer<string>
    {
        public int Compare(string? x, string? y)
        {
            return removeComments(x).CompareTo(removeComments(y));
        }

        public static NoCommentsComparer instance = new NoCommentsComparer();
    }

    private static string GetSignature(IGraph g, INode n1, bool withComments = false)
    {

        int[] visited = new int[g.order];

        var getFullSignature = new Func<INode, int, String>((start, depth) => { return ""; });

        getFullSignature = (INode start, int depth) =>
        {
            if (visited[start.id] > 0) return "/*N" + start.id + ":*/" + (depth - visited[start.id] - 1);
            else
            {
                visited[start.id] = depth;
                var adjacentNodeStrings = start.adjacentNodes.Select(n =>
                {
                    if (n == n1) return $"/*N{n}:*/0";
                    else return getFullSignature(n, depth + 1);
                }).ToArray();
                // Array.Sort(adjacentNodeStrings, NoCommentsComparer.instance);
                var result = String.Join(',', adjacentNodeStrings);
                visited[start.id] = 0;
                return "/*N" + start.id + ":*/[" + result + "]";
            }
        };

        var getSignature = new Func<INode, int, String>((start, depth) => { return ""; });

        getSignature = (INode start, int depth) =>
        {
            if (visited[start.id] > 0) return (depth - visited[start.id] - 1).ToString();
            else
            {
                visited[start.id] = depth;
                var adjacentNodeStrings = start.adjacentNodes.Select(n =>
                {
                    if (n == n1) return "0";
                    else return getSignature(n, depth + 1);
                }).ToArray();
                Array.Sort(adjacentNodeStrings);
                var result = String.Join(',', adjacentNodeStrings);
                visited[start.id] = 0;
                return "[" + result + "]";
            }
        };
        var signature = (withComments)
            ? getFullSignature(n1, 1)
            : getSignature(n1, 1);
        return signature;
    }


    private static string GetSignatures(ISubGraph subgraph, bool withComments = false)
    {
        var signatures = new List<string>();
        foreach (var n1 in subgraph.nodes)
        {
            signatures.Add(GetSignature(subgraph.graph, n1, withComments));
        }
        string result;
        if (!withComments) signatures.Sort();

        var delim = withComments ? ",\n" : ",";
        result = "[" + String.Join(delim, signatures) + "]";
        return result;
    }

    private static string GetSignaturesII(ISubGraph subgraph, bool withComments = false)
    {
        var a = new int[5, 5];
        var b = new int[5, 5];
        Console.WriteLine(a.GetHashCode());
        Console.WriteLine(b.GetHashCode());

        // var signatures = new List<string>();
        var nodeCount = subgraph.nodes.Count;
        object?[,] previousSignatures = new object[nodeCount, nodeCount];
        object?[,] signatures = new object[nodeCount, nodeCount];
        for (int pass = 0; pass < nodeCount; pass++)
        {
            for (var i1 = 0; i1 < nodeCount; i1++)
            {
                var n1 = subgraph.nodes[i1];
                if (pass == 0)
                {
                    for (var i2 = 0; i2 < nodeCount; i2++)
                    {

                        signatures[i1, i2] = (i1 == i2) ? null : n1.adjacentNodes.Count;
                    }
                }
                else
                {
                    for (var i2 = 0; i2 < nodeCount; i2++)
                    {
                        signatures[i1, i2] = n1.adjacentNodes.Select(n =>
                        {
                            return previousSignatures[n.id, i2];
                        }).ToArray();
                    }
                }
            }
            previousSignatures = signatures;
        }
        string result = "";
        //if (!withComments) signatures.Sort();

        var delim = withComments ? ",\n" : ",";
        //result = "[" + String.Join(delim, signatures) + "]";
        return result;
    }

    static void TestSignature(string g6, string expectedSignature, bool withComments = false)
    {
        var subgraph = (G6.parse(g6).AsSubGraph())!;
        var actualSignature = GetSignatures(subgraph, withComments);
        TestEngine.AssertEquals($"Graph {g6} signature", () => actualSignature, expectedSignature);
        var newSignature = GetSignaturesII(subgraph, withComments);
        TestEngine.AssertEquals($"Graph {g6} new signature", () => newSignature, expectedSignature);
    }

